const wooConfig = {
  siteUrl: process.env.REACT_APP_SITE_URL,
  consumerKey: process.env.REACT_APP_CONSUMER_KEY,
  consumerSecret: process.env.REACT_APP_CONSUMER_SECRET,
};

module.exports = wooConfig;
